/// <summary>
/// A GitHub Security Advisory.
/// </summary>
public record GlobalAdvisory
{
    /// <summary>
    /// The GitHub Security Advisory ID.
    /// </summary>
    [JsonPropertyName("ghsa_id")]
    public required string GhsaId { get; init; }

    /// <summary>
    /// The Common Vulnerabilities and Exposures (CVE) ID.
    /// </summary>
    [JsonPropertyName("cve_id")]
    public required string? CveId { get; init; }

    /// <summary>
    /// The API URL for the advisory.
    /// </summary>
    [JsonPropertyName("url")]
    public required string Url { get; init; }

    /// <summary>
    /// The URL for the advisory.
    /// </summary>
    [JsonPropertyName("html_url")]
    public required Uri HtmlUrl { get; init; }

    /// <summary>
    /// The API URL for the repository advisory.
    /// </summary>
    [JsonPropertyName("repository_advisory_url")]
    public required Uri? RepositoryAdvisoryUrl { get; init; }

    /// <summary>
    /// A short summary of the advisory.
    /// </summary>
    [JsonPropertyName("summary")]
    public required string Summary { get; init; }

    /// <summary>
    /// A detailed description of what the advisory entails.
    /// </summary>
    [JsonPropertyName("description")]
    public required string? Description { get; init; }

    /// <summary>
    /// The type of advisory.
    /// </summary>
    [JsonPropertyName("type")]
    public required GlobalAdvisoryType Type { get; init; }

    /// <summary>
    /// The severity of the advisory.
    /// </summary>
    [JsonPropertyName("severity")]
    public required GlobalAdvisorySeverity Severity { get; init; }

    /// <summary>
    /// The URL of the advisory's source code.
    /// </summary>
    [JsonPropertyName("source_code_location")]
    public required Uri? SourceCodeLocation { get; init; }

    [JsonPropertyName("identifiers")]
    public required IReadOnlyList<object>? Identifiers { get; init; }

    [JsonPropertyName("references")]
    public required IReadOnlyList<string>? References { get; init; }

    /// <summary>
    /// The date and time of when the advisory was published, in ISO 8601 format.
    /// </summary>
    [JsonPropertyName("published_at")]
    public required DateTimeOffset PublishedAt { get; init; }

    /// <summary>
    /// The date and time of when the advisory was last updated, in ISO 8601 format.
    /// </summary>
    [JsonPropertyName("updated_at")]
    public required DateTimeOffset UpdatedAt { get; init; }

    /// <summary>
    /// The date and time of when the advisory was reviewed by GitHub, in ISO 8601 format.
    /// </summary>
    [JsonPropertyName("github_reviewed_at")]
    public required DateTimeOffset? GithubReviewedAt { get; init; }

    /// <summary>
    /// The date and time when the advisory was published in the National Vulnerability Database, in ISO 8601 format.
    /// This field is only populated when the advisory is imported from the National Vulnerability Database.
    /// </summary>
    [JsonPropertyName("nvd_published_at")]
    public required DateTimeOffset? NvdPublishedAt { get; init; }

    /// <summary>
    /// The date and time of when the advisory was withdrawn, in ISO 8601 format.
    /// </summary>
    [JsonPropertyName("withdrawn_at")]
    public required DateTimeOffset? WithdrawnAt { get; init; }

    /// <summary>
    /// The products and respective version ranges affected by the advisory.
    /// </summary>
    [JsonPropertyName("vulnerabilities")]
    public required IReadOnlyList<Vulnerability>? Vulnerabilities { get; init; }

    [JsonPropertyName("cvss")]
    public required object? Cvss { get; init; }

    [JsonPropertyName("cvss_severities")]
    public CvssSeverities? CvssSeverities { get; init; }

    /// <summary>
    /// The EPSS scores as calculated by the [Exploit Prediction Scoring System](https://www.first.org/epss).
    /// </summary>
    [JsonPropertyName("epss")]
    public SecurityAdvisoryEpss? Epss { get; init; }

    [JsonPropertyName("cwes")]
    public required IReadOnlyList<object>? Cwes { get; init; }

    /// <summary>
    /// The users who contributed to the advisory.
